      <text id="25" justification="0" size="4" underlined="false">
        <text>So hatte ich mir die Berechnung der Flugbahn ursprünglich vorgestellt,
calculatePositions() berechnet die einzelnen Positionen der Flugbahn,
die werden dann in mPositions gespeichert</text>
      </text>

      <text id="31" justification="0" size="4" underlined="false">
        <text>Alternativ kann man die Positionen in einem Path zusammenfassen,
entlang dessen dann die Kugel fliegt,
je nach dem, wie die Animation am Ende ausgeführt wird
(PathTransition?)
In dem Fall kann die Klasse auch statisch werden</text>
      </text>

      <text id="46" justification="0" size="4" underlined="false">
        <text>Die Berechnung der Flugbahn mit Luftwiderstand beachtet folgende Faktoren:
- Fläche des Durchschnitts der Kugel
- Masse der Kugel
- Luftdichte (fest)
- Luftwiderstandskonstante abh. von Form des Körpers</text>
